import React from "react";

class Checkbox extends React.Component {

    render() {
        return (
            <input
                type = {this.props.type}
                name = {this.props.name}
                checked = {this.props.checked}
                onChange = {this.props.onChange}
            />
        );
    }
}

class Hairstyles extends React.Component {
    constructor() {
        super();

        this.state = {
            womenShort: [],
            womenMedium: [],
            womenLong: [],
            menShort: [],
            menLong: []
        };
    }

    render() {
        const checkboxes = [
            {
                name: "check-box-1",
                key: "checkBox1",
                label: "Check Box 1"
            },
            {
                name: "check-box-2",
                key: "checkBox2",
                label: "Check Box 2"
            },
            {
                name: "check-box-3",
                key: "checkBox3",
                label: "Check Box 3"
            },
            {
                name: "check-box-4",
                key: "checkBox4",
                label: "Check Box 4"
            }
        ];

        return (
            <div className="App">

            </div>
        );
    }
}
export default Hairstyles;
